"use strict";jQuery(document).ready(function(){$("#Save").on("click",function(e){e.preventDefault();var o={name:$("#name").val(),type:$("#type").val(),room:$("#room").val()};$.ajax({type:"POST",data:JSON.stringify(o),contentType:"application/json",url:"/api/auth/add"}).done(function(e){console.log(e.ok),e.ok?$(location).attr("href","/devices"):($(".error").remove(),$("#device").before('<span class="error">'+e.error+"</span>"))})})});